import {StyleSheet} from "react-native"

const styles = StyleSheet.create({
    formContext: {
        width:"100%",
        height:"100%",
        bottom:0,
        backgroundColor:"#ffffff",
        alignItems:"center",
        marginTop:30,
        borderTopLeftRadius:30,
        borderTopRightRadius:30,
    },
    form:{
        width:"100%",
        height:"auto",
        marginTop: 30,
        padding:30,


    },
    formLabel:{
        color:"#000000",
        fontSize:15,
        paddingLeft:10,
    },
    formInput:{
        width: "90%"
    }
    
});

export default styles
